	/**
	 * 校验组织机构代码或社会统一信用代码
	 * 
	 * @param orgCode
	 *            待校验的组织机构代码
	 * @return true 表示合法,false 表示不合法
	 */
	public static boolean validate(String orgCode) {
		// 判断是否为空
		if (null == orgCode || orgCode.isEmpty()) {
			return false;
		}

		// 根据长度判断该用"社会统一信用代码规则"还是"组织机构代码规则"校验
		if (18 == orgCode.length()) {
			return validate18orgCode(orgCode);
		} else if (9 == orgCode.length()) {
			return validate9orgCode(orgCode);
		} else {
			return false;
		}

	}

	/**
	 * @Title: validate18orgCode
	 * @Descroption:
	 * @param orgCode
	 * @return boolean
	 */
	private static boolean validate18orgCode(String orgCode) {
		// 校验字符是否合法 应由数字或字母A-Y组成，且不包含I、O、S、V
		Pattern pat = Pattern.compile("^[0-9A-Y]*$");
		Matcher matcher = pat.matcher(orgCode);
		if (!matcher.matches()) {
			return false;
		}
		pat = Pattern.compile("^(?:(?!(I|O|S|V)).)*$");
		matcher = pat.matcher(orgCode);
		if (!matcher.matches()) {
			return false;
		}

		int sum = sum(orgCode);
		int temp = sum % 31;
		temp = temp == 0 ? 31 : temp;// 如果余数位0，则取31
		
		return orgCode.substring(17).equals(code[31 - temp] + "");
	}

	/**
	 * @Title: sum
	 * @Descroption:
	 * @param string
	 * @return int
	 */
	private static int sum(String orgCode) {
		char[] chars = orgCode.substring(0, 17).toCharArray();

		int sum = 0;
		for (int i = 0; i < chars.length; i++) {
			char tt = chars[i];
			int code = datas.get(tt + "");
			sum += power[i] * code;
		}
		return sum;

	}

	/**
	 * @Title: validate9orgCode
	 * @Descroption:校验9位的组织机构代码
	 * @param orgCode
	 * @return boolean
	 */
	private static boolean validate9orgCode(String orgCode) {
		// Pattern pat = Pattern.compile("^[0-9A-Z]{8}-[0-9X]$");前8位数字字母-数字或X ，
		Pattern pat = Pattern.compile("^[0-9A-Z]{8}[0-9X]$");
		Matcher matcher = pat.matcher(orgCode);
		if (!matcher.matches()) {
			return false;
		}
		final int[] wi = { 3, 7, 9, 10, 5, 8, 4, 2 };
		// String[] all = orgCode.split("-");
		final char[] values = orgCode.toCharArray();
		int parity = 0;
		for (int i = 0; i < values.length - 1; i++) {
			final String val = Character.toString(values[i]);
			if(!map.containsKey(val)) {
				return false;
			}
			parity += wi[i] * Integer.parseInt(map.get(val).toString());
		}
		String cheak = (11 - parity % 11) == 10 ? "X" : Integer.toString((11 - parity % 11));

		return cheak.equals(orgCode.substring(8));
	}
